export const actionTypes = {
    GET_ALL_QBANK_MAIN_CATEGORY_REQUEST: 'GET_ALL_QBANK_MAIN_CATEGORY_REQUEST',
    GET_ALL_QBANK_MAIN_CATEGORY_SUCCESS: 'GET_ALL_QBANK_MAIN_CATEGORY_SUCCESS',
    GET_INACTIVE_QBANK_MAIN_CATEGORY_REQUEST: 'GET_INACTIVE_QBANK_MAIN_CATEGORY_REQUEST',
    GET_INACTIVE_QBANK_MAIN_CATEGORY_SUCCESS: 'GET_INACTIVE_QBANK_MAIN_CATEGORY_SUCCESS'
};

export function getAllQBankMainCategory(payload) {
    return { type: actionTypes.GET_ALL_QBANK_MAIN_CATEGORY_REQUEST, payload };
}

export function getAllQBankMainCategorySuccess(payload) {
    return { type: actionTypes.GET_ALL_QBANK_MAIN_CATEGORY_SUCCESS, payload };
}

export function getInactiveQBankMainCategory(payload) {
    return { type: actionTypes.GET_INACTIVE_QBANK_MAIN_CATEGORY_REQUEST, payload };
}

export function getInactiveQBankMainCategorySuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_QBANK_MAIN_CATEGORY_SUCCESS, payload };
}
